import styled from 'styled-components';

export const SongItemWrapper = styled.div`
    display: flex;
    align-items: center;
    .song-item{
        padding: 6px 10px;
        text-align: left;
    }
    .rank-count{
        padding-left: 25px;
        width: 70px;
        color: #999;
    }

`
